import React, { useState } from 'react';
import './App.css';

function App() {
  const [activeTab, setActiveTab] = useState('messages');
  const [currentNote, setCurrentNote] = useState('');
  const [notes, setNotes] = useState([]);

  const addNote = () => {
    if (currentNote.trim()) {
      setNotes([...notes, { id: Date.now(), text: currentNote, date: new Date() }]);
      setCurrentNote('');
    }
  };

  return (
    <div className="container">
      <header className="header">
        <div className="new-badge">NEW!</div>
        <h1>Our Special Connection</h1>
        <p>...distance means so little when you mean so much...</p>
        <p>Welcome to our love nest on the World Wide Web! ♥♥♥ Est. 2025 ♥♥♥</p>
      </header>

      <div className="nav-bar">
        <div className="nav-title">:: NAVIGATION BAR ::</div>
        <ul className="nav-buttons">
          <li>
            <button 
              className={`nav-button ${activeTab === 'home' ? 'active-button' : ''}`}
              onClick={() => setActiveTab('home')}
            >
              ★ Home ★
            </button>
          </li>
          <li>
            <button 
              className={`nav-button ${activeTab === 'calendar' ? 'active-button' : ''}`}
              onClick={() => setActiveTab('calendar')}
            >
              ♥ Calendar
            </button>
          </li>
          <li>
            <button 
              className={`nav-button ${activeTab === 'messages' ? 'active-button' : ''}`}
              onClick={() => setActiveTab('messages')}
            >
              Messages
            </button>
          </li>
          <li>
            <button 
              className={`nav-button ${activeTab === 'pets' ? 'active-button' : ''}`}
              onClick={() => setActiveTab('pets')}
            >
              Our Pets
            </button>
          </li>
        </ul>
      </div>

      <div className="content-area">
        {activeTab === 'messages' && (
          <div className="message-board">
            <h2>.:*~* Message Board *~*:.</h2>
            <div className="message-title">★ Leave a Sweet Message ★</div>
            <textarea
              value={currentNote}
              onChange={(e) => setCurrentNote(e.target.value)}
              placeholder="Write a sweet note for your partner..."
              rows="4"
            />
            <div style={{ textAlign: 'center' }}>
              <button 
                className="post-button"
                onClick={addNote}
              >
                Post Note!
              </button>
            </div>

            {notes.length === 0 && (
              <div style={{ textAlign: 'center', marginTop: '20px' }}>
                <p>No messages yet! Be the first to post something sweet!</p>
              </div>
            )}
          </div>
        )}
      </div>

      <div className="dots">
        <div className="dot" style={{ backgroundColor: '#ff5555' }}></div>
        <div className="dot" style={{ backgroundColor: '#ffaa00' }}></div>
        <div className="dot" style={{ backgroundColor: '#33cc33' }}></div>
        <div className="dot" style={{ backgroundColor: '#3399ff' }}></div>
        <div className="dot" style={{ backgroundColor: '#9966ff' }}></div>
      </div>

      <footer className="footer">
        <p>© 2025 - Our Love Shack on the Information Superhighway</p>
        <p>Best viewed in Internet Explorer 6.0 or Netscape Navigator</p>
        <div className="counter">
          <div className="counter-item">
            Visitors: 2,345
          </div>
          <div className="counter-item online-indicator">
            <div className="online-dot"></div> Online Now
          </div>
        </div>
      </footer>
    </div>
  );
}

export default App;
